			'modified' => '2013-12-12 21:00:59',
			'language_id' => '42',
			'name' => 'Bounces represents the percentage of visitors who enter the site and \'bounce\' (leave the site) rather than continue viewing other pages within the site. Bounce rates can be used to help determine the effectiveness or performance of an entry page. An entry page with a low bounce rate means that the page effectively causes visitors to view more pages and continue on deeper into the web site. A pageview is an instance of a page being loaded by a browser. The Pageviews metric is the total number of pages viewed; repeated views of a single page are also counted. Visitors is the number of user visit your site. Bounces represents the percentage of visitors who enter the site and \'bounce\' (leave the site) rather than continue viewing other pages within the site. The graph is use to trace step wise completion of user\'s property post/book so it helps admin to find in which step user interrupt without complete their posting/booking. This analysis helps admin to improve the clarity of property post steps thereby increase the property post/book.',
			'lang_text' => 'Bounces represents the percentage of visitors who enter the site and \'bounce\' (leave the site) rather than continue viewing other pages within the site. Bounce rates can be used to help determine the effectiveness or performance of an entry page. An entry page with a low bounce rate means that the page effectively causes visitors to view more pages and continue on deeper into the web site. A pageview is an instance of a page being loaded by a browser. The Pageviews metric is the total number of pages viewed; repeated views of a single page are also counted. Visitors is the number of user visit your site. Bounces represents the percentage of visitors who enter the site and \'bounce\' (leave the site) rather than continue viewing other pages within the site. The graph is use to trace step wise completion of user\'s property post/book so it helps admin to find in which step user interrupt without complete their posting/booking. This analysis helps admin to improve the clarity of property post steps thereby increase the property post/book.',
