			'name' => 'A page view is an instance of a page being loaded by a browser. The Page views metric is the total number of pages viewed; repeated views of a single page are also counted. Visitors is number of user visit the site. Bounces represents the percentage of visitors who enter the site and \'bounce\' (leave the site) rather than continue viewing other pages within the site. Also it shows the graphical representation of the already existing user\'s visit and new user visit rate. Recent Activity shows the last 3 site activities. To see the list of all activities please click \'More\' button. User engagment shows current status site users. An overview of site activities such as registerations, logins, posts, funfs, revenue and performance comparison with previous period',
